import React from "react";
import { StyleSheet, Text, View, TextInput } from "react-native";
import styless4 from "./estilos.sass";
import Icon from "react-native-vector-icons/FontAwesome";
import Contacts from "react-native-contacts";
import Posicionamiento from "../components/Mapa/Posicionamiento";
/*
import NumeroTelefono from "../NumeroTelefono/NumeroTelefono";
*/
export default class PaginaPrincipal extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    console.log("d" + this.props.DatosGPS);
    return (
      <>
        {/*Titulo APP*/}
        <View style={styless4.containerT}>
          {/*    <Icon name="map" style={styles.Icono}/>*/}
          <Text style={styles.Titulo}>Find your friends:</Text>
        </View>
        {/*Datos GPS* y Mapa*/}


   {/* <NumeroTelefono/>*/}


        <Posicionamiento />
     
      </>
    );
  }
}
const styles = StyleSheet.create({
  Icono: {
    width: "auto",
    fontSize: 35,
    color: "white",
    marginRight: 10,
  },
  Titulo: {
    width: "auto",
    textShadowColor: "rgba(0, 0, 0, 0.75)",
    textShadowOffset: { width: -1, height: 1 },
    textShadowRadius: 10,
    color: "white",
    height: "auto",
    fontSize: 30,
  },
});
